import React from "react";
import "./App.css";
import MainComp from "./MainComp/MainComp";
import Search from "./Search/Search";
import Playlist from "./Playlist/Playlist";
import Cplay from "./CreatePlaylist/Cplay";
import {Routes,Route} from "react-router-dom";
import { useState } from "react";
export default function App(){

  const [home,setHome]=useState(false);
  const [search,setSearch]=useState(false);
  const [play,setPlay]=useState(false);
  const [crpl,setCrpl]=useState(false);

    return(
        <>
        <Routes>
          <Route exact path='/' element={<MainComp home={setHome(true)}/>}/>
          <Route exact path='/search' element={<Search search={setSearch(true)}/>}/>    
          <Route exact path='/playlist' element={<Playlist Play={setPlay(true)}/>}/>    
          <Route exact path='/Crplaylist' element={<Cplay CrPl={setCrpl(true)}/>}/>    
        </Routes>

        </>
    );
}
